webpackJsonp([46431705512696],{7900:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.tchibo.de/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/06/tchibo-black-hooded-fashion.jpg" alt="tchibo black hooded sweater" title="" align="right" /></a>Just in time for the G-8 protest season, Tchibo is offering <a href="http://www.tchibo.de/is-bin/INTERSHOP.enfinity/eCS/Store/de/-/EUR/TdTchBrowseCatalog-Start;sid=AXK1WD1ZDU60uns9XXC_PD7bepdvs5CBWj0=?CategoryName=preview&amp;source=NAVI">basic designer black fashion</a> perfect for demonstrators prone to violence. Also at <a href="http://www.tchibo.co.uk/is-bin/INTERSHOP.enfinity/eCS/Store/uk/-/GBP/TdUkBrowseCatalog-Start;sid=BBuOPNLWVXaOPJSyWYqEWNFD1ZWJdH-3HHI=?CategoryName=preview&amp;source=NAVI">Tchibo UK</a>.</p>\n<p>Speaking of which, is anyone outside of Germany paying attention to the violent protests in Rostock. Security for the G-8 conference is the <a href="http://www.heute.de/ZDFheute/inhalt/26/0,3672,5546682,00.html">main headline</a> in Germany, but I have a feeling that elsewhere the protests are more of a dog-bites-man story... it would only be newsworthy if there were <em>no</em> violent protests.</p>\n<p><a href="http://www.heute.de/ZDFheute/inhalt/26/0,3672,5546682,00.html"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/06/zdf-rostock.jpg" alt="Zdf Rostock" height="170" width="244" /></a></p>',fields:{title:"Fashion for the Children of Heiligendamm",date:"04 Jun 2007",url:"https://papascott.de/2007-06-04-fashion-for-the-children-of-heiligendamm/"}}},pathContext:{slug:"/2007-06-04-fashion-for-the-children-of-heiligendamm/",prev:{fields:{title:"The Blueberry Hercules",date:"31 May 2007",slug:"/2007-05-31-the-blueberry-hercules/"}},next:{fields:{title:"Birthday Present",date:"11 Jun 2007",slug:"/2007-06-11-birthday-present/"}}}}}});
